script: |
  super -f text -I q5835.spq | sort > q5835.out

inputs:
  - name: q5835.spq
    data: |
      SELECT ALL - + col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - CAST ( NULL AS INTEGER ) * col0 + + 15 BETWEEN col0 AND + col0 * - 39;
  - name: tab2

outputs:
  - name: q5835.out
    data: |
